## Config for our equipment

```nix
{ pkgs, ... }: {

# --- Printer ---
  services.printing = {
    enable = true;
    drivers = with pkgs; [ gutenprint cups-filters ];
  };
  users.users.%USERNAME%.extraGroups = [ "plugdev" "avahi" ];
  systemd.services.cups-browsed.serviceConfig.TimeoutStopSec = 2;

  # Fails if printer not found
  # hardware.printers = {
  #     ensurePrinters = [
  #         {
  #             name = "HP_Laser_MFP_135w";
  #             location = "Hacker Embassy";
  #             deviceUri = "ipp://embassy-printer.lan";
  #             model = "everywhere";
  #         }
  #     ];
  #     ensureDefaultPrinter = "HP_Laser_MFP_135w";
  # };


# --- CumPod ---
  networking.firewall.allowedUDPPorts = [ 6001 6002 ];
  # credits: https://github.com/cab404/home/blob/master/modules/recipes/audio.nix#L8

  services.pipewire.extraConfig = {
    pipewire = {
      "100-user" = {
        "context.modules" = [
            { name = "libpipewire-module-zeroconf-discover"; }
            { name = "libpipewire-module-raop-discover"; 
              raop.autoreconnect = true;
            }
        ];
      };
    };
  };
}
```
